class ImgDatset(Dataset):
    def __init__(self, file_list, transform):
        self.transform = transform
        self.file_list = file_list
        self.label_list = [label_num for i in range(len(self.file_list))]
        # 여기서는 라벨들이 다 똑같으므로, file_list갯수만큼 하면될 듯 합니다.
        # wrong의 라벨은 모두 2로 동일합니다.

    def __len__(self):
        return len(self.file_list)

    def __getitem__(self, idx):

        img_path = self.file_list[idx]
        label = self.label_list[idx]

        image = cv2.imread(img_path, cv2.IMREAD_COLOR)
        # 여기선 무조건 transform 해야합니다.

        transformed = self.transform(image=image)
        image = transformed['image']

        # image= np.array(image)
        # cv2.imshow('kk', image)
        # cv2.waitKey(0)

        return image, label


def graphPlot(train_loss, val_loss, xlabel, ylabel, title, xticksRange=(0,100,5)):
    plt.xlabel(xlabel)
    plt.ylabel(ylabel)
    plt.title(title)
    # print(xticksRange)
    # plt.xticks()
    # 필요시 xticks 쓰기

    plt.plot(train_loss, label='train Loss')
    plt.plot(val_loss,   label='val Loss')
    plt.legend()
    plt.show()


